export function ProductRow(props) {
    return (
        <>
            {props.data.map((row, index) =>
                row.category === props.category
                && ((row.stocked === true && props.onlyInStock === true) || props.onlyInStock === false)
                && <ProductRowRender key={index} name={row.name} price={row.price} />
            )}
        </>
    )
}

function ProductRowRender(props) {
    return (
        <>
            <tr>
                <td>{props.name}</td>
                <td>{props.price}</td>
            </tr>
        </>
    )
}
